INSERT INTO `stic_settings` VALUES ('10bbe32b-ad76-43a6-872d-2e569d657069','SEPA_TRANSFER_DEBITOR_IDENTIFIER','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Organization identifier for SEPA transfer remittances. The value may differ from one bank to another. Please ask them which value you should use.',0,'1','SEPA',''),('15e3baf6-6e13-e79c-ee76-5235850cf8cd','TPV_CURRENCY','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Currency code for the payment gateway (978 = Euro).',0,'1','TPV','978'),('294f7c6c-5166-cea4-220a-523589f2854f','TPV_PASSWORD','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Password for real mode, provided by the payment gateway.',0,'1','TPV',''),('34e479af-35a4-2d47-26a5-518b8a4d6bc2','M182_CLAVE_DONATIVO','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Deberá rellenarse por las entidades acogidas al régimen de deducciones recogidas en el Título III de la Ley 49/2002, de 23 de diciembre, según el siguiente detalle:\n\rA. Donativos no incluidos en las actividades o programas prioritarios de mecenazgo establecidos por la Ley de Presupuestos Generales del Estado. Valor por defecto (habitual para las entidades usuarias de SinergiaCRM).\n\rB. Donativos incluidos en las actividades o programas prioritarios de mecenazgo establecidos por la Ley de Presupuestos Generales del Estado.\n\rTratándose de aportaciones o disposiciones relativas a patrimonios protegidos, deberá consignarse alguna de las siguientes claves:\n\rC. Aportación al patrimonio de discapacitados.\n\rD. Disposición del patrimonio de discapacitados.\n\rE. Gasto de dinero y consumo de bienes fungibles aportados al patrimonio protegido en el año natural al que se refiere la declaración informativa o en los cuatro anteriores para atender las necesidades vitales del beneficiario y que no deban considerarse como disposición de bienes o derechos a efectos de lo dispuesto en el artículo 54.5 de la Ley 35/2006, de 28 de noviembre, del Impuesto sobre la Renta de las Personas Físicas.',0,'1','M182','A'),('46a61ece-821c-11e8-9c7c-00163e7f1a26','GENERAL_IBAN_VALIDATION','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','1 - The IBAN will be validated. This is the default value and the value used for all those organizations inside SEPA.\r\n0 - The IBAN will not be validated, so the field will accept any value. Only for organizations outside SEPA.',0,'1','GENERAL','1'),('46aa0f7b-821c-11e8-9c7c-00163e7f1a26','SEPA_TRANSFER_DEFAULT_REMITTANCE_INFO','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Information that will appear in the payment order if there is no info in the payment record.',0,'1','SEPA',''),('46cd35a1-821c-11e8-9c7c-00163e7f1a26','GENERAL_PAYMENT_GENERATION_MONTH','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Generate recurring payments for:\r\n0 - Current month\r\n1 - Next month.',0,'1','GENERAL','0'),('4d7d1c1f-335b-c88b-1a53-5ff2d0935406','SEPE_CODIGO_AGENCIA','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Organization identifier for SEPE reports. 10 digits code',0,'1','SEPE',''),('4efc55c0-0145-4282-3691-518b83e91075','M182_PERSONA_CONTACTO_TELEFONO','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','',0,'1','M182',''),('5accf323-9416-3c6d-62d9-518b836467fb','M182_PERSONA_CONTACTO_APELLIDO_2','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','',0,'1','M182',''),('5cd71028-09ec-2b1c-54bf-518b8344004a','M182_PERSONA_CONTACTO_NOMBRE','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','',0,'1','M182',''),('778903f8-1fcc-2e3d-3fc1-523585707228','TPV_MERCHANT_NAME','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','The name of your organization, that will be shown in the payment gateway.',0,'1','TPV',''),('7de47385-e036-bea9-0946-56a129d7b3b1','M182_NUMERO_JUSTIFICANTE','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Código numérico de 13 dígitos que identifica la declaración. Debe consignarse un nuevo valor antes de generar el fichero de un nuevo ejercicio. Se puede obtener en https://www2.agenciatributaria.gob.es/L/inwinvoc/es.aeat.adht.nume.web.editran.NumRefEditran?mod=182',0,'1','M182',''),('846d3469-acef-db6c-41bc-518cccb58b4a','M182_PORCENTAJE_DEDUCCION_AUTONOMICA_XX','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Las organizaciones que puedan ofrecer deducciones adicionales a sus donantes en determinadas comunidades autónomas deberán crear claves de configuración del tipo M182_PORCENTAJE_DEDUCCION_AUTONOMICA_XX, donde XX deberá ser el código de la comunidad autónoma y el valor de la clave deberá ser el porcentaje de deducción aplicable (con dos decimales y sin símbolo de %). Se pueden consultar los códigos de las comunidades en https://wiki.sinergiacrm.org/index.php?title=Formas_de_pago,_Pagos_y_Remesas#Notas_adicionales_sobre_las_constantes_del_Modelo_182',0,'1','M182',''),('921e5673-9d0c-7e04-94c8-523585ccff61','TPV_MERCHANT_CODE','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Unique numeric code provided by the payment gateway.',0,'1','TPV',''),('978a2000-022b-5c5e-0cd7-518b8313e761','M182_PERSONA_CONTACTO_APELLIDO_1','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','',0,'1','M182',''),('9a3548a7-0588-44d4-29a6-518b827f360c','GENERAL_ORGANIZATION_ID','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Any code suitable for officially identifying your organization. In Spain, NIF should be used.',0,'1','GENERAL',''),('b78ec43e-957d-94c3-b128-530da9b40a84','SEPA_BIC_CODE','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','BIC code of your bank. This will only be used when SEPA_DEBIT_BIC_MODE is 1.',0,'1','SEPA',''),('b9755f82-72c9-d361-10b7-5b40699f14c4','TPV_TEST','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Indicates the working mode (0 = Real, 1 = Test).',0,'1','TPV','1'),('ba936db7-e756-6d97-c38e-5b40693b0287','TPV_PASSWORD_TEST','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Password for test mode, provided by the payment gateway.',0,'1','TPV',''),('bbe94f29-25e2-7680-d32e-5b4069f29df2','PAYPAL_ID','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','User identifier or email address of your PayPal BUSINESS account.',0,'1','PAYPAL',''),('bc2be16f-38dc-3e4b-e0ae-5b4069cc347a','PAYPAL_ID_TEST','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Email address of your PayPal SANDBOX account (developer.paypal.com).',0,'1','PAYPAL',''),('bc77f99d-ba05-2f65-a967-5b406973ce68','PAYPAL_TEST','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Indicates the working mode (0 = Real, 1 = Test).',0,'1','PAYPAL','1'),('bd7a0703-76c8-eed9-a455-518cba43f3ce','M182_NATURALEZA_DECLARANTE','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Se hará constar el dígito numérico indicativo de la naturaleza del declarante, de acuerdo con la siguiente relación:\n\r1. Entidad beneficiaria de los incentivos regulados en el Título III de la Ley 49/2002, de 23 de diciembre, de régimen fiscal de las entidades sin fines lucrativos y de los incentivos fiscales al mecenazgo.\n\r2. Fundación legalmente reconocida que rinde cuentas al órgano del protectorado correspondiente o asociación declarada de utilidad pública a que se refieren elartículo 68.3.b) de la Ley del Impuesto sobre la Renta de las Personas Físicas.\n\r3. Titular o administrador de un patrimonio protegido regulado en la Ley 41/2003, de 18 de noviembre, de protección patrimonial de las personas con discapacidad y de modificación del Código Civil, de la Ley de Enjuiciamiento Civil y de la Normativa Tributaria con esta finalidad.\n\r4. Partidos Políticos, Federaciones, Coaliciones o Agrupaciones de Electores en los términos previstos en la Ley Orgánica 8/2007, de 4 de julio, de financiación de partidos políticos.',0,'1','M182','1'),('cc9ba14d-e56c-5d8e-ae18-52358805cda7','TPV_TERMINAL','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Terminal number, provided by the payment gateway. Usually number 1, but could be 2, 3, etc. depending on wether your organization has one or more POS terminals.',0,'1','TPV','1'),('d26ed2ae-2574-43ac-93d6-487baeca28d7','SEPA_DEBIT_DEFAULT_REMITTANCE_INFO','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Information that will appear in the debit order if there is no info in the payment record.',0,'1','SEPA',''),('d4f6e75e-e50d-11e9-b361-fa163e94e8de','SEPA_DEBIT_BIC_MODE','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','When set to 0 (default value), BIC is not included in remittances. When set to 1 the value of SEPA_BIC_CODE will be included. Some banks, like Santander, demand it, although it is not necessary.',0,'1','SEPA','0'),('dbc49c32-25f7-a1ee-728d-518b824a16fc','GENERAL_ORGANIZATION_NAME','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','The name of your organization. It will be used wherever is needed: bank remittances, tax files, etc.',0,'1','GENERAL',''),('eacb2339-7741-96d7-3fd6-531f07485832','SEPA_DEBIT_CREDITOR_IDENTIFIER','2022-02-19 09:00:16','2022-02-19 09:00:16','1','1','Unique identifier for SEPA direct debit remittances. More information in https://wiki.sinergiacrm.org/index.php?title=Formas_de_pago,_Pagos_y_Remesas#Constantes_SEPA_para_remesas_de_recibos_domiciliados',0,'1','SEPA','');
